(7, 1, 1, 'Scooter elettrico', '<div class=\"result-block bp5-card bp5-elevation-0\" style=\"padding:2px 5px;margin:1px 0px 8px;color:#182026;font-family:\'-apple-system\', BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', Icons16, sans-serif;font-size:14px;\">\r\n<div class=\"bp5-collapse\" style=\"height:auto;\">\r\n<div class=\"bp5-collapse-body\">\r\n<div class=\"common-result\">\r\n<div class=\"general-result\">\r\n<p style=\"margin:2px 0px;line-height:1.3;\">\"Scopri la nostra selezione di scooter elettrici per privati ​​e professionisti, disponibili in negozio e online. Goditi una mobilità ecologica e pratica con i nostri modelli di fascia alta. Sfoglia oggi stesso la nostra gamma per trovare lo scooter elettrico che si adatta perfettamente alle tue esigenze.\"<button type=\"button\" title=\"朗读\" class=\"bp5-button bp5-minimal bp5-small\" style=\"font-family:inherit;font-size:14px;line-height:1.15;margin:0px;padding:0px 7px;text-align:left;vertical-align:middle;background-image:none;color:#1c2127;border:none;\"><span class=\"bp5-icon bp5-icon-volume-up\" style=\"margin:0px -7px;vertical-align:text-bottom;color:#5f6b7c;\"></span></button></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"result-block bp5-card bp5-elevation-0\" style=\"padding:2px 5px;margin:8px 0px;color:#182026;font-family:\'-apple-system\', BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', Icons16, sans-serif;font-size:14px;\">\r\n<div class=\"legend\">\r\n<div class=\"legend-left\"></div>\r\n</div>\r\n</div>', 'scooter-elettrico', '', '', ''),
(7, 1, 2, 'Scooter elettrico', '', 'scooter-elettrico', '', '', ''),
(8, 1, 1, 'Moto elettrica', '<div class=\"category-description category-description-top hidden-sm-down\" style=\"font-family:\'Open Sans\', sans-serif;font-size:14px;\">\r\n<div class=\"result-block bp5-card bp5-elevation-0\" style=\"padding:2px 5px;margin:1px 0px 8px;color:#182026;font-family:\'-apple-system\', BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', Icons16, sans-serif;\">\r\n<div class=\"bp5-collapse\" style=\"height:auto;\">\r\n<div class=\"bp5-collapse-body\">\r\n<div class=\"common-result\">\r\n<div class=\"general-result\">\r\n<p style=\"margin:2px 0px;line-height:1.3;\">Oltre ai monopattini elettrici vendiamo anche alcune moto con notevole autonomia!<button type=\"button\" title=\"朗读\" class=\"bp5-button bp5-minimal bp5-small\" style=\"font-family:inherit;font-size:14px;line-height:1.15;margin:0px;padding:0px 7px;text-align:left;vertical-align:middle;background-image:none;color:#1c2127;border:none;\"><span class=\"bp5-icon bp5-icon-volume-up\" style=\"margin:0px -7px;vertical-align:text-bottom;color:#5f6b7c;\"></span></button></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"result-block bp5-card bp5-elevation-0\" style=\"padding:2px 5px;margin:8px 0px;color:#182026;font-family:\'-apple-system\', BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', Icons16, sans-serif;\">\r\n<div class=\"legend\">\r\n<div class=\"legend-left\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div id=\"js-active-search-filters\" class=\"hide\"></div>\r\n</div>\r\n<div>\r\n<div id=\"js-product-list-top\" class=\"products-selection\" style=\"margin:0px;padding:0px;border-top:1px solid;border-bottom:1px solid;\">\r\n<div class=\"row align-items-center justify-content-between small-gutters\">\r\n<div class=\"col col-auto facated-toggler\" style=\"width:auto;\"></div>\r\n<div class=\"col view-switcher\" style=\"width:185.2px;font-size:18px;\">